import React from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";

// Sections for this page
import SignupSection from "../components/Home/section4";
import TestimonialsSection from "../components/Home/section5";
import HeroSection from "../components/Home/section1";
import IntroSection from "../components/Home/section2";
import WelcomeSection from "../components/Home/section6";

const Home = () => {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/hero">Hero</Link>
            </li>
            <li>
              <Link to="/intro">Intro</Link>
            </li>
            <li>
              <Link to="/signup">Signup</Link>
            </li>
            <li>
              <Link to="/testimonials">Testimonials</Link>
            </li>
            <li>
              <Link to="/welcome">Welcome</Link>
            </li>
          </ul>
        </nav>

        <Route path="/hero" component={HeroSection} />
        <Route path="/intro" component={IntroSection} />
        <Route path="/signup" component={SignupSection} />
        <Route path="/testimonials" component={TestimonialsSection} />
        <Route path="/welcome" component={WelcomeSection} />
      </div>
    </Router>
  );
};

export default Home;
